import { Grid, Card, CardContent } from '@material-ui/core';
import Styles from './styles';

const ShowClimas = () => {
	return (
		<Grid item sm={4}>
			<Card>
				<CardContent>
					Soy agregar1
				</CardContent>
			</Card>
		</Grid>
	);
}

export default ShowClimas;
